<script>
	$(function () {
		order=Math.floor(Math.random() * (12 - 1)) + 1;
		$.getJSON("json/sampledata"+order+".json", function(data){
			//desperate 10 items
			first=data[0];
			var ts=document.getElementsByName("title");
			for(var t in ts){
				ts[t].innerHTML=first.SHRT_DES;
			}
			for(var i=1;i<data.length;i++){
				var d=data[i];
				document.getElementById("fldes"+i).innerHTML=d.SHRT_DES;
				document.getElementById("fgroup"+i).innerHTML=document.getElementById(d.GRP_CD).innerHTML;
				var nut=eval(d.NUT_DATA)[0];
				var content='';
				for(var key in nut){
					if(nut[key]!=0){
						var name=document.getElementById("N"+key).innerHTML;
						var unit=document.getElementById("U"+key).innerHTML;
						content+="<tr><td>"+name+"</td><td>"+nut[key]+"</td><td>"+unit+"</td></tr>";
					}	
				}
						
				document.getElementById("nut"+(i-1)).innerHTML=content;
			}
		});
	});

</script>
	

